import React from "react";

const Footer = () => {
  return (
    <div
      style={{ height: "1000px" }}
      className="bg-gray-800 w-full fixed bottom-0 h-12 text-gray-300 flex items-center justify-between"
    >
      This is the footer
    </div>
  );
};

export default Footer;
